import React from "react";
import image1 from "../images/novice.png";
import image2 from "../images/university.png";


const cards = [

    {
        id: 1,
        title: 'Novice',
        image: image1
    },

    {
        id: 2,
        title: 'University',
        image: image2
    },

    {
        id: 3,
        title: 'Gamer',
    }

]

export default cards;
